import { nanoid } from "nanoid";

export default function TrueSquare(props) {
    return (
        <button 
            className="true-square"
                value={props.value}
                onClick={() => props.handleClick(props.id)}
                id={props.id}
                key={nanoid()}
        ></button>
    );
}
